use dep::noir_ml::{layers::fc, activations::poly, utils::arg_max};

global w1: [Field; 20] = [16, -15, 13, -27, 26, -4, -16, -18, -8, 3, -7, 7, 10, 1, -13, -16, 2, 1, 12, -15];
global b1: [Field; 10] = [20, -74, -82, -53, -91, 36, -216, -43, 219, -95];

